import React from "react";

export const ShowTotalComponent =({hotel})=>{
   const {services,name} =hotel;

    return(
        <div className="hotel-info">
            <p>{name}</p>
            <p className="total-vote" style={{ 
                backgroundColor: "#fff",width: "100px",
                height: "auto",
                paddingLeft: "2px",
    marginLeft: "5px"}
            }>{services.reduce((strt,curr)=>{
                return strt+curr.votes
            },0)}
            </p>
        </div>
    );
}
